import { Link, NavLink, useParams } from 'react-router-dom';
import { useEffect, useState } from 'react'
import adminAxiosInstance from '../../../adminaxiosconfig';
import AdminNavbar from '../../../components/AdminComponents/AdminNavbar';



const UserDetail = () => {

  const { id } = useParams();
  const [user, setUser] = useState(null);
  const [deliveries,setDeliveries] = useState(null)
  const [deliverlen, setDeliverylen] = useState(null)
  useEffect(() => {
      adminAxiosInstance.get(`userdetail/${id}/`)
          .then((response) => {
            console.log(response.data.deliveries)
            setUser(response.data.user);
            setDeliveries(response.data.deliveries);
          })
          .catch((error) => console.error(error));


  }, [id]);

  if (!user) {
    return (
      <div className="p-6">
        <p>Loading...</p>
      </div>
    ); // Show loading message if user data is null
  }

  return (

    <>   

    < AdminNavbar />


     <body class="bg-white text-black font-sans">
    <main class="container mx-auto py-8">
      <section class="flex items-center space-x-8">
        <img 
          src="https://via.placeholder.com/150" 
          alt="Profile Picture" 
          class="w-36 h-36 rounded-full"
        />
        <div>
          <h2 class="text-4xl font-bold">{user.username}</h2>
          <p class="text-gray-700">{user.first_name} {user.last_name}</p>
          {/* <p class="text-gray-700 mt-1">{user.email}</p> */}
        </div>
      </section>

      <section class="mt-8">
        <h3 class="text-2xl font-semibold mb-4">Details</h3>
        <dl class="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <dt class="text-gray-500">Email</dt>
            <dd class="font-medium">{user.email}</dd>
          </div>
          <div>
            <dt class="text-gray-500">Phone</dt>
            <dd class="font-medium">+{user.phone_number}</dd>
          </div>
          <div>
            <dt class="text-gray-500">date joined</dt>
            <dd class="font-medium">{user.date_joined}</dd>
          </div>
          <div>
            <dt class="text-gray-500">Last Login</dt>
            <dd class="font-medium">{user.last_login}</dd>
          </div>

        </dl>
      </section>

      <section class="mt=8">
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {deliveries.map((delivery) => (
            <div
              key={delivery.id}
              className="bg-white border rounded-lg shadow-lg p-6"
            >
              <h2 className="text-xl font-semibold text-orange-500 mb-4">
                Delivery ID: {delivery.id}
              </h2>
              <p className="text-gray-600">
                <strong>From:</strong> {delivery.from_address.address_line_1}, {delivery.from_address.city}, {delivery.from_address.state}
              </p>
              <p className="text-gray-600">
                <strong>To:</strong> {delivery.to_address.address_line_1}, {delivery.to_address.city}, {delivery.to_address.state}
              </p>
              <p className="text-gray-600">
                <strong>Package Size:</strong> {delivery.package_size}
              </p>
              <p className="text-gray-600">
                <strong>Status:</strong> {delivery.status}
              </p>
              <p className="text-gray-600">
                <strong>Details:</strong> {delivery.details}
              </p>
              <div className="mt-4">
                <NavLink
                  to={`/deliveries/${delivery.id}`}
                  className="text-blue-500 hover:underline"
                >
                  View Details
                </NavLink>
              </div>
            </div>
          ))}
        </div>
      </section>

    </main>



  </body>

  </>

  )
};

export default UserDetail
